import Card from "./Card";
import data from "./Sdata";
function App() {
  return (
    <>
      <h1 className="heading_style"> Top 5 series of Netflex</h1>
      <Card
        imagsrc={data[0].imagsrc}
        title={data[0].title}
        sname={data[0].sname}
        link={data[0].link}
          />
          
    </>
  );
}
export default App;
